package com.amandris.clients.web.view;import java.util.ArrayList;import org.apache.struts.action.ActionForm;public class VoteDataView extends ActionForm{	private String 		positiveVotes;	private String 		negativeVotes;	private String 		totalVotes;	private String		positiveVotesPercentage;	private ArrayList 	votes; 		private static final long serialVersionUID = 1526471155622776003L;		public VoteDataView()	{		positiveVotes			= "";		negativeVotes			= "";		totalVotes				= "";		positiveVotesPercentage	= "";		votes					= new ArrayList(); 	}	public String getNegativeVotes() {		return negativeVotes;	}	public void setNegativeVotes(String negativeVotes) {		this.negativeVotes = negativeVotes;	}	public String getPositiveVotes() {		return positiveVotes;	}	public void setPositiveVotes(String positiveVotes) {		this.positiveVotes = positiveVotes;	}	public String getPositiveVotesPercentage() {		return positiveVotesPercentage;	}	public void setPositiveVotesPercentage(String positiveVotesPercentage) {		this.positiveVotesPercentage = positiveVotesPercentage;	}	public String getTotalVotes() {		return totalVotes;	}	public void setTotalVotes(String totalVotes) {		this.totalVotes = totalVotes;	}	public ArrayList getVotes() {		return votes;	}	public void setVotes(ArrayList votes) {		this.votes = votes;	}	}